# Database Functions
def createDatabase(Cursor):
    Cursor.execute("CREATE TABLE Passwords(purpose text, password text)")

def addEntry(Cursor, entry):
    Cursor.execute("INSERT INTO Passwords VALUES(?, ?)", (entry.purpose, entry.password))

def removeEntry(Cursor, purpose):
    Cursor.execute("DELETE FROM Passwords WHERE purpose = ?", (purpose,))
    
def changeEntry(Cursor, entry):
    Cursor.execute("UPDATE Passwords SET password = ? WHERE purpose = ?",(entry.password, entry.purpose))

def retrieveEntry(Cursor, purpose):
    Cursor.execute("SELECT password FROM Passwords WHERE purpose = ?", (purpose,))
    password = Cursor.fetchone()
    if password != None:
        return password[0]
    else:
        return password

def retrieveAll(Cursor):
    Cursor.execute("SELECT * FROM Passwords")
    password = Cursor.fetchall()
    return password
# Database Functions end

# Database Encryption Functions
def encryptDatabase(password, data):
    exception = [1, 1]
    salt = get_random_bytes(256)
    with open("salt", "wb") as saltfile:
        saltfile.write(salt)
        exception[0] = 0
    
    with open("UVault.enc", "wb") as dataenc:
        key = hashlib.scrypt(password, salt=salt, n=2**14, r=8, p=1, dklen=32)
        cipher = AES.new(key, AES.MODE_GCM)
        ciphertext, tag = cipher.encrypt_and_digest(data.encode("utf8"))
        [dataenc.write(x) for x in (cipher.nonce, tag, ciphertext) ]
        exception[1] = 0

    return True

def decryptDatabase(password):
    exception = [1, 1]
    with open("salt", "rb") as saltfile:
        salt = saltfile.read()
        exception[0] = 0

    with open("UVault.enc", "rb") as dataenc:
        nonce, tag, ciphertext = [ dataenc.read(x) for x in (16, 16, -1) ]
        key = hashlib.scrypt(password, salt=salt, n=2**14, r=8, p=1, dklen=32)
        cipher = AES.new(key, AES.MODE_GCM, nonce)
        data = cipher.decrypt_and_verify(ciphertext, tag)
        exception[1] = 0

    if 1 in exception:
        return None
    else:
        return data.decode("utf8")

def checksum(Cursor):
    value = retrieveEntry(Cursor, "checksum")
    if value == "bccd30e889cb6af72091f5faf246c4f2b2e27fde2fcff73cf86440ce94810af5":
        return True
    else:
        return False
# Database Encryption Functions end

